import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Rock Paper Scissors
        </p>
        <form>
          <input placeholder="Your username..."/>
          <button>Send</button>
        </form>
      </header>
    </div>
  );
}

export default App;
